using System;
using System.Collections.Generic;
using P2Webasm.Model;

namespace P2Webasm.Misc
{
    public interface IDatabase
    {
        void Initialise();
        public List<Product> GetAll();
        Product GetOne(Guid id);
        void Delete(Product id);
        void Update(Product p);
        void Insert(Product p); 
    }

    public class Database : IDatabase
    {
        private List<Product> products = new List<Product>();
        public void Delete(Product p)
        {
           Console.WriteLine("Selected product Id" + p.Id);
            for(var i = 0; i < products.Count; i++) {
                Console.WriteLine(i);
                if (products[i].Id.Equals(p.Id))
                {
                    products.RemoveAt(i);
                }
            }   
        }

        public List<Product> GetAll()
        {
            return products;
        }

        public Product GetOne(Guid id)
        {
            return products.Find(pr => pr.Id == id);

        }

        public void Initialise()
        {
            Product p1 = new Product();

            var Product1 = new Product
            {
                Id = Guid.NewGuid(),
                Name = "Duck",
                Desc = "A duck quacks",
                Colour = "White",
                Image = "",
                Price = 123
            };

            var Product2 = new Product
            {
                Id = Guid.NewGuid(),
                Name = "Chicken",
                Desc = "A chicken cookoos",
                Colour = "Yellow",
                Image = "",
                Price = 234
            };

            var Product3 = new Product
            {
                Id = Guid.NewGuid(),
                Name = "Goose",
                Desc = "A goose geeses",
                Colour = "Green",
                Image = "",
                Price = 345
            };

            var Product4 = new Product
            {
                Id = Guid.NewGuid(),
                Name = "Birb",
                Desc = "A birb claws at you and eats you alive",
                Colour = "Gray",
                Image = "",
                Price = 456
            };

            products.Add(Product1);
            products.Add(Product2);
            products.Add(Product3);
            products.Add(Product4);
        }

        public void Insert(Product p)
        {
            Console.WriteLine(p.Image);
            products.Add(p);
        }

        public void Update(Product p)
        {

            for (var i = 0; i < products.Count; i++)
            {
                Console.WriteLine(i);
                if (products[i].Id.Equals(p.Id))
                {
                    products[i] = p;
                }
            }
        }
    }

}
